			function hitTestObject(obj1, obj2) {
				if (obj1 && obj2) {
					var posunX = 33.4;
					var posunY = 33;
					var angle = obj2.rotation / 180 * Math.PI;
					var aWidth = obj1.nominalBounds.width * obj1.scaleX;
					var aHeight = obj1.nominalBounds.height * obj1.scaleY;
					//var bWidth = obj2.nominalBounds.width * obj2.scaleX;
					//var bHeight = obj2.nominalBounds.height * obj2.scaleY;
					var bWidth = Math.abs(obj2.nominalBounds.width * obj2._props.matrix.a) + Math.abs(obj2.nominalBounds.height * obj2._props.matrix.c);
					var bHeight = Math.abs(obj2.nominalBounds.width * obj2._props.matrix.b) + Math.abs(obj2.nominalBounds.height * obj2._props.matrix.d);
					var mca = new Object();
					var mcb = new Object();
					var obj1Global = obj1;
					var obj2LocalX = posunX * obj2._props.matrix.a + posunY * obj2._props.matrix.c + obj2._props.matrix.tx;
					var obj2LocalY = posunX * obj2._props.matrix.b + posunY * obj2._props.matrix.d + obj2._props.matrix.ty;
					var obj2Global = obj2.parent.localToGlobal(obj2LocalX, obj2LocalY);

					mca.xr = obj1Global.x + (aWidth / 2); //the right edge of movieclip A
					mca.xl = obj1Global.x - (aWidth / 2); //the left edge of movieclip A
					mca.yt = obj1Global.y - (aHeight / 2); //the top edge of movieclip A
					mca.yb = obj1Global.y + (aHeight / 2); //the bottom edge of movieclip A

					mcb.xr = obj2Global.x + (bWidth / 2);
					mcb.xl = obj2Global.x - (bWidth / 2);
					mcb.yt = obj2Global.y - (bHeight / 2);
					mcb.yb = obj2Global.y + (bHeight / 2);

					xHit = mca.xr > mcb.xl && mca.xl < mcb.xr; // returns true if the is any horisontal  overlappnig
					yHit = mca.yt < mcb.yb && mca.yb > mcb.yt; // returns true if the is any vertical overlapping

					if (xHit && yHit) {
						return true;
					}
				}

			}

